import React from 'react'

function Landing() {
  return (
    <div className='container-div'>
        <img src="./images/edited.jpg" alt="profile"/>
        <h1>I am Kelvin</h1>
        <p>Web developer</p><span className='span'>|</span>
        <div className="social-links">
          
        </div>
    </div>
  )
}

export default Landing
